import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { motion } from 'framer-motion';
import { FiTrash2, FiEdit, FiEye } from 'react-icons/fi';
import { useTranslation } from '../context/TranslationContext';

const MyQuizzes = () => {
  const [quizzes, setQuizzes] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [deleting, setDeleting] = useState(null);
  const { t, updateKey, currentLanguage, translateQuizList } = useTranslation();

  useEffect(() => {
    fetchMyQuizzes();
  }, [updateKey]);

  const fetchMyQuizzes = async () => {
    setLoading(true);
    try {
      const res = await axios.get('/api/user/quizzes');
      
      // Tłumacz quizy jeśli język nie jest polski
      let translatedQuizzes = res.data;
      if (currentLanguage !== 'pl') {
        translatedQuizzes = await translateQuizList(res.data, currentLanguage);
      }
      
      setQuizzes(translatedQuizzes);
      setError('');
    } catch (err) {
      setError(t('Błąd podczas pobierania quizów.'));
    }
    setLoading(false);
  };

  const handleDelete = async (quizId) => {
    if (!window.confirm(t('Czy na pewno chcesz usunąć ten quiz? Tej operacji nie można cofnąć.'))) {
      return;
    }

    setDeleting(quizId);
    try {
      await axios.delete(`/api/quizzes/${quizId}`);
      setQuizzes(quizzes.filter(q => q.id !== quizId));
    } catch (err) {
      alert(err.response?.data?.error || t('Błąd podczas usuwania quizu.'));
    }
    setDeleting(null);
  };

  return (
    <motion.div className="container fade-in" initial={{ opacity: 0 }} animate={{ opacity: 1 }} key={updateKey}>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', margin: '32px 0 24px 0' }}>
        <h2>{t('Moje Quizy')}</h2>
        <Link to="/create-quiz" className="btn btn-primary">
          {t('Utwórz nowy quiz')}
        </Link>
      </div>
      
      {loading ? (
        <div>{t('Ładowanie quizów...')}</div>
      ) : error ? (
        <div style={{ color: 'red' }}>{error}</div>
      ) : quizzes.length === 0 ? (
        <div className="card" style={{ textAlign: 'center', padding: '40px' }}>
          <h3>{t('Nie masz jeszcze żadnych quizów')}</h3>
          <p style={{ marginBottom: '20px' }}>{t('Utwórz swój pierwszy quiz i udostępnij go innym!')}</p>
          <Link to="/create-quiz" className="btn btn-primary">
            {t('Utwórz pierwszy quiz')}
          </Link>
        </div>
      ) : (
        <div style={{ display: 'flex', flexWrap: 'wrap', gap: 24, justifyContent: 'center' }}>
          {quizzes.map(quiz => (
            <motion.div
              className="card fade-in"
              key={quiz.id}
              whileHover={{ scale: 1.02 }}
              style={{ minWidth: 300, maxWidth: 400 }}
            >
              <h3 style={{ marginBottom: 8 }}>{quiz.title}</h3>
              <div style={{ color: '#764ba2', fontWeight: 500, marginBottom: 8 }}>{quiz.category}</div>
              <div style={{ marginBottom: 8 }}>{quiz.description}</div>
              <div style={{ fontSize: 14, color: '#888', marginBottom: 8 }}>
                {t('Pytania')}: {quiz.questionCount} | {t('Poziom')}: {t(quiz.difficulty === 'easy' ? 'Łatwy' : quiz.difficulty === 'medium' ? 'Średni' : 'Trudny')} | {t('Język')}: {quiz.language}
              </div>
              <div style={{ fontSize: 14, color: '#888', marginBottom: 16 }}>
                {t('Utworzono')}: {new Date(quiz.createdAt).toLocaleDateString()}
              </div>
              
              <div style={{ display: 'flex', gap: 8, flexWrap: 'wrap' }}>
                <Link to={`/quizzes/${quiz.id}`} className="btn btn-secondary" style={{ flex: 1, display: 'flex', alignItems: 'center', justifyContent: 'center', gap: 6 }}>
                  <FiEye />
                  {t('Podgląd')}
                </Link>
                <button 
                  className="btn btn-danger" 
                  onClick={() => handleDelete(quiz.id)}
                  disabled={deleting === quiz.id}
                  style={{ display: 'flex', alignItems: 'center', gap: 6 }}
                >
                  <FiTrash2 />
                  {deleting === quiz.id ? t('Usuwanie...') : t('Usuń')}
                </button>
              </div>
            </motion.div>
          ))}
        </div>
      )}
    </motion.div>
  );
};

export default MyQuizzes;
